// src/components/Member.js
import React from "react";
import styled from "styled-components";

const Container = styled.div`
  text-align: center;
  padding: 2rem;
`;

const Title = styled.h1`
  font-size: 2.5rem;
`;

const Description = styled.p`
  font-size: 1.2rem;
`;

const Member = () => {
  return (
    <Container>
      <Title>Our Member</Title>
      <Description>Information about the Member goes here.</Description>
    </Container>
  );
};

export default Member;
